<h1><a name="vjmsgcompilererrorj0022"></a>Compiler Error J0022</h1>
<p class=dt>
<b>Expected end of file</b></p>
<p>
The compiler expected to encounter an end-of-file character, but did not. This error usually occurs when the source file has been damaged in some way. Visually check the source file for obvious corruption, save any changes, and compile again.</p>
